        "review_header": "Great Sound, Unfortunately Not Very Sturdy",
        "review_id": "RX1ECWZ7M0XBF",
        "review_text": "So the individual features they ask you to rate all apply to sound, as as far as sound goes these are great for the price.  However, the part that locks the headphones in place when you move them from folded to ready to wear broke early on in the life of my pair.  This wasn't super bothersome, as you only really keep them unfolded if you're going to wear them, and they aren't spring loaded or anything crazy to where they try and close while you're wearing them.  Folding and unfolding is strictly a manual event, and as a 45 year old man I know the value of NOT trying to do something odd like hold one earpiece and fling them open.  I always GENTLY opened them and put them on.  The other week, as I removed them, I *did* hold them by one side and reached out to put them down.  The unit broke where the hard plastic meets the soft bit that cushions your head.  They don't fold there naturally.  I've NEVER flung them down in anger or otherwise done anything other than take them off and set them down in a calm fashion.TL;DR - Good sound, super fragile.  Treat them like they're made of glass.",
