        "review_text": "I have never written an Amazon review before but these headphones are just something else.  Since I was in high school I have bought, these 2 headphones because the quality of these headphones are something else.Incredibly comfortable, I have a small head so I always have to just headphones to fir my head, and children's headphones are a bit tight and usually cheaper quality. These headphones fit just right.They also cover my entire ear completely, making noise harder to get into my ear. Even if I am not listening to anything I like having them on because they stop noises from entering my ear.Because the sound quality is so good and very loud, I don't have to put my headphones on full when in a noisy room. If you are a student and get easily distracted by noises, parents, family, etc. these headphones will help you concentrate.I attribute my good math grades in college to these headphones because I could listen to music during tests and not hear other people's noises. (clearing throats, shuffling, etc,) helping me focus on my math tests a lot easier.To wrap things up, its amazing for students, to block noise, very comfortable on head and ears, easy to use,  only downside was the first time I got these headphones the mic did not work; but the second time buying them they did. I recommend to students, teachers, travelers, children, adults, office workers, etc.",
