        "review_header": "You get what you pay for!",
        "review_id": "R20H4JJF16D6S5",
        "review_text": "Another lesson learned, when it comes to electronics you get what you pay for. The RORSOU R10 headphones are compact, but that is where the un-asterisked positives end. My pair arrived half broken; the right side non-functional out of the box with no obvious fix. The sound out of the left side is of moderate quality, so I imagine that a functional pair would sound about the same. The headphones feel sturdy and are fairly comfortable for short-term wear, but the padding material on the headband will pull at your hair. They don't look professional either, so they are best for casual use, maybe with a hat or hood between your head and the headband... Final verdict: If you can afford these headphones, you can probably afford to swing for a $50 pair and spare yourself some headache (literally.) If you're on a tight budget, you would be better served with a cheaper, plain black pair -- it will still get the job done -- and you won't feel so bad if they're half-broken on arrival!",
