        "review_header": "Love!",
        "review_id": "R3OA3TG0UCXP7R",
        "review_text": "UPDATE: On 2/26/2024 these headphones broke on the actual headband area, right above the hinge where the ear covers can fold inward. I dont think is a defect, as these are meant for kids and I am obviously not one, but I aslo have been fairly rough with these and throwing them in my bag for a year to get jumbled around. Still love them, planning on just gluing it back since they still work.I needed new headset for work as my work-issued JABRAs are old and finally broke. I wanted the following things:-headset NOT earbuds (earbud never stay in)-wired so I dont have to worry about charging or taking up a valuable USB port-non-bluetooth so i dont have to worry about issues connecting-no installation software. I have a company issued laptop, so i can't install anything.- good enough sound. I'm using these for work so calls and listening to things on a laptop. don't need anything super noise cancelling, bass, surround sound or anything.I figured i'd take a chance but had low expectations as these were pretty cheap. I LOVE them. They are colorful which is just a bonus but these fit comfortable over my ears, which is great because I have small ears and often my ears feel smashed wearing headsets. The sound is great. The wire is fabric-threaded and not stiff, long enough so its easy to move around and not knock things over and im not worried about it fraying all over the place. All in all, a GREAT purchase for the price point.",
