        "review_header": "Good sound at an attractive price",
        "review_id": "R343R42JCD89BJ",
        "review_text": "I often use these when practicing on my Yamaha clp-745 digital piano.  Sound through the headphones is actually better than through the piano's speakers (which is typical with headphones....I'm told).  Makes playing the piano sound like an acoustic 9' grand piano. It does lack some in the upper two octaves but delivers very good bass sound. Mid-range notes sound good but are not as crisp as you might want but still sound amazing. And the most amazing thing is I have purchased 4 or5 five other headphones off Amazon which were priced at twice what this one cost.  I had to send most of them back because they were so bad. I used to always refer to Amazon reviews when selecting an item, but lately I am thinking they may be made up. So...main thought is that these inexpensive headphones sound great for what they cost and I recommend you give them a try. I am an adult and they fit and feel good on my head.",
