        "review_header": "Sound is amazing for $20 headphones",
        "review_id": "R21TXY1HCPIO6N",
        "review_text": "Pros:The sound quality is literally amazing, I do feel like I'm an audiophile and love listening to music and listening with good speakers/sound. For $20 these sound better than other headphones I've tried that are $50+. I wish they made these in wireless because I would buy them immediately. Noise cancelation is pretty good as well, it's not amazing but way better than I though I'd get for $20, you do have to have your music loud for it to work, so lowkey not sure if the noise cancelation is working or if it's just my music that's loudCons:The speaker sucks and doesn't relay well at all, I've had to unplug and use my laptop/phone's speaker for people to be able to hear me in meetings and calls. There is also audio leakage so if someone is next to you and you're blasting music they'll probably hear lol but that's not that a big of a deal to me, I'd rather have good sound quality than care if my sound is slightly leaking.Overall review:Solid headphones especially for the price, will definitely buy again for the sound quality alone!",
