        "review_header": "Not sure if this is meant for PCs.",
        "review_id": "R1JHJZ4K3I574D",
        "review_text": "I bought these for use with a \"real\" PC, not a laptop or some other device. For some reason, the sound quality is bizarrely muffled and garbage...unless the button on the cord is actively being pressed down, which makes it perfectly fine. A cursory search didn't find anyone else having this issue, so I'm not sure if I'm just unlucky or if these are meant for more \"modern\" computers or what. I resolved the issue myself by tightly strapping the button down with tape...but I shouldn't have to do that with a set of brand-new headphones.Other than that admittedly-serious flaw, the hardware's pretty good for the price. Noise cancellation is great, it's decently comfortable, and it feels pretty robust. I'm not going to bother trying to get mine refunded or replaced, but I have to say that I'm not going to be buying these again in the future.",
