        "review_text": "Not sure if it's only the pink color, but I triple checked and nowhere does it say these are child size. These headphones squeeze really hard under both ears. They fit tightly all around and keep out sound, but don't use noise cancelling technology. These fit my 5 year old perfectly on the smallest setting and fit all around her head. I have an oval head, not square or large so I'm confused why these hurt so bad to wear. I am giving these to my 5 year old and I will have to find a new pair.The sound quality is great, for the price. For music, everything is in balance, but the sound isn't as full and robust as it could be. It's not muffled and the bass is good. The sound is nice and loud, and I didn't have to turn the volume up much at all.",
