        "review_header": "Equates the quality to its price.",
        "review_id": "RH74NKBJXSU2L",
        "review_text": "It's not bad for $20.00 but if this product was more, I would not be happy with them. The initial physical quality is actually pretty good. They feel and look very sturdy. The sound quality is what suffers. It's far better than a set of skull candy earbuds; however, the sound is like that of listening to music with a can or a plastic cup on your ear. I get used to it halfway through a song, but it's not a timbre I admire in a pair of headphones. Noise cancelation is a lie. These do not have any such technology. The only escape from ambient noise comes from the padding. It's noise muffling, not noise canceling. With that said, the padding doesn't do too bad of a job. I at first thought I was listening with noise canceling tech. For music, I would not recommend these. For simple gaming or in any other application where the sound quality is not a priority or you just want a cheap set of head phones without going with buds, I'd say save money and buy these.",
