        "review_id": "RJWYA77XONTFR",
        "review_text": "I do a lot of transcription at work and wanted a new pair of headphones, but needed a moderately long cable to reach the plug into my work computer. The cord was long enough, and the headphones seem reasonably well constructed. The audio quality was fine for what I needed, but I also didn't really test them with music.I like that my ears can fit pretty much entirely within the cups, without the padded parts pressing on them them, but the padded parts are soft enough that it probably wouldn't be a big deal if they did. However, I find they're a little bit tight on my head so they're uncomfortable to wear with my glasses. I also am not a fan of where they press on the joint of my jaw. It's not painful, just unpleasant.Since I need to wear the headphones for long period of time, I need to be really comfortable, so I'm planning on returning it because I don't need another big pair of headphones hanging around. (I already have a pair for home use, but the cable isn't long enough to reach my work computer.)",
