        "review_header": "These are really some great headphones for the price; but no privacy.",
        "review_id": "R1R2HDZJAN9G11",
        "review_text": "No.  They are not the anything and everything.  I kind of wish I spent some more to get some wireless earbuds.  But you are not going to go wrong with this headset.  It has great sound quality.  They do a great job sealing sound out, so you think all is quiet.  But the headset leaks a lot of noise.  I love listening to music, but I have found that I am being too loud.  These headphones kill all the outside noise and drop into a place of no distractions.  I love the sound quality of these headphones.  While you may think that you are in a quiet space alone with these headphones, you are going to have to think about those around you.  They are going to hear everything that you hear.  Be aware and be wise.  Sound quality is great, privacy quality sucks.  Everything that you hear, everyone around you hears the same.  No privacy if that is what you seek.",
